import React from 'react'
import "./Footer.css";
import ProperImage from './ProperImage';

const Footer = () => {
    return (
      <footer>
        <ProperImage image={'goi-cuon'}/>
        <div>
          <p>
            <a style={{textDecoration: `none`, color: `white`}}href="https://vietnguyen.dev/">Viet Nguyen | 2021</a>
          </p>
        </div>
      </footer>
    );
}

export default Footer
